    dist = [float('inf')] * (x + 1)
    predecessors = {0: None}
    open_list = [(0, 0)]
    for i in range(1, x+1): 
        min_dist, min_node = dist[i-1], None
        for j in range(i, x+1): 
            if (cost[j][i] < dist[i]): 
                dist[i] = cost[j][i]
                min_dist = dist[i]
                min_node = j
        if min_dist < dist[i]: 
            dist[i] = min_dist
            predecessors[i] = min_node
        open_list.append((dist[i], i))
    return dist[x], predecessors[x]
